import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain from './brain.png'
import './Logo.css';

const Logo = () => {
	return (
		<div className= 'ma4 mt0'>
			<Tilt className="Tilt br2 shadow-2" tiltMaxAngleX={25} tiltMaxAngleY={25} scale={1.1} >
      			<div style={{ height: '150px' }}><img alt='logo' src={brain}/></div>

    		</Tilt>
		</div>
	); 
}

export default Logo;
